package main

import (
	"encoding/hex"
	"log"

	"github.com/iotexproject/iotex-core/blockchain/block"
	"github.com/vmihailenco/msgpack/v5"
)

func main() {
	data := ""
	data1, _ := hex.DecodeString(data)
	e := &block.Block{}
	err := msgpack.Unmarshal(data1, e)
	if err != nil {
		log.Fatal(err)
	}
}
